import React from "react";

const Footer = () => {
    var time = new Date().getFullYear();


    return(
        <>
        <div className="row">
        <div className="col-12">
            <p className="text-center">Copyright {time}</p>
        </div>
            
        </div>
            
        </>
    )
}

export default Footer;
